, por lo que se desarrollan los músculos abdominales superiores y los músculos del six pack.\nAumenta la fuerza de los músculos abdominales: La función principal de los músculos abdominales es estabilizar la sección media. Te apoya mientras levantas objetos pesados, lo que te permite girar y rotar tu cuerpo. Estas son acciones de todo el día que no notas, por lo que es importante que tus músculos abdominales puedan soportar largas horas de trabajo. El ejercicio crunch ayuda a desarrollar esta importante resistencia en los músculos abdominales. La resistencia muscular es la capacidad de estas fibras para resistir la resistencia durante mucho tiempo.","created":"2024-07-01T10:37:52.307456+02:00","category":10,"muscles":[14,6],"muscles_secondary":[],"equipment":[7],"language":4,"license":2,"license_author":"hektkaso","variations":[],"author_history":["hektkaso"]},{"id":1754,"uuid":"4edfa74a-6fbc-4b8d-81b7-db3f8a93a828","name":"Arremetidas inversas","exercise_base":999,"description":"<p>Posición inicial:</p><p>De pie, con los pies separados a la altura de las caderas.</p><p>Pasos:</p><ol><li>Da un paso hacia atrás con una pierna para que pueda doblarse cómodamente hasta un ángulo de 90 grados.</li><li>Doble lentamente ambas rodillas hasta formar un ángulo de 90 grados.</li><li>Vuelva a la posición inicial.</li><li>Repita, alternando las piernas.</li></ol>","created":"2023-08-06T10:17:17.349574+02:00","category":9,"muscles":[],"muscles_secondary":[],"equipment":[7],"language":4,"license":2,"license_author":null,"variations":[1545,1754],"author_history":["mondstern (imported from Feeel)","Diego Sanguinetti (imported from Feeel)","Gabriel Tandil (imported from Feeel)","Luis Alfredo Figueroa Bracamontes (imported from Feeel)"]},{"id":1470,"uuid":"57c9e05f-d7fd-4588-b6b0-65b49831b6cb","name":"Asiento en pared","exercise_base":718,"description":"<ol><li>Apóyese en la pared, mirando hacia adelante y con los pies plantados firmemente en el suelo, sus hombros deben separarse y estar a 50 centímetros de la pared</li><li>Deslízate por la pared, manteniendo la espalda presionada a ella, hasta que las piernas estén en ángulo recto. Las rodillas deben estar directamente sobre los tobillosEl dolor en el cuádriceps es normal, deténgase si siente dolor en la rodilla o en la rótula</li></ol>","created":"2023-08-06T10:17:17.349574+02:00","category":9,"muscles":[11,10],"muscles_secondary":[],"equipment":[7],"language":4,"license":3,"license_author":"Blablabla","variations":[1939,1366,1456,1470],"author_history":["mondstern (imported from Feeel)","Luis Alfredo Figueroa Bracamontes (imported from Feeel)","Diego Sanguinetti (imported from Feeel)","Gabriel Tandil (imported from Feeel)","Blablabla"]},{"id":1162,"uuid":"952d450f-e7cc-4f09-ada0-ddea1a47b492","name":"Barbell Hip Thrust","exercise_base":294,"description":"Siéntate en el suelo con un banco detrás de ti, dobla las rodillas para que tus pies estén plantados en el suelo y sujeta una barra que descanse debajo de tus caderas. Si tienes una barra acolchada o algo que puedas colocar entre la barra y tu cuerpo, te resultará más cómodo.","created":"2023-08-06T10:17:17.349574+02:00","category":9,"muscles":[8],"muscles_secondary":[],"equipment":[1,8],"language":4,"license":2,"license_author":"Bret Contreras","variations":[],"author_history":["enros7500","Bret Contreras"]},{"id":2158,"uuid":"831f44bf-f69a-4ef2-a5ed-3c5148c318ba","name":"Biceps con TRX","exercise_base":958,"description":"músculos implicados: bíceps Agarre las asas de las correas TRX, incline el cuerpo hacia atrás, brazos y piernas extendidos, cuerpo posicionado en una sola línea. (no es de abdominales, es de brazos)","created":"2023-11-10T16:03:05.317838+01:00","category":10,"muscles":[1],"muscles_secondary":[],"equipment":[7],"language":4,"license":2,"license_author":"clafal","variations":[],"author_history":["clafal","cynomops"]},{"id":2090,"uuid":"cb1655ee-bfb4-46eb-84a8-cc70e69f0ed1","name":"Biceps concentrado","exercise_base":1109,"description":"El curl de concentración es un ejercicio clásico para desarrollar los bíceps un brazo a la vez. Se puede realizar inclinado o de rodillas, pero se realiza más a menudo sentado en un banco. Es excelente para enfatizar el pico del bíceps y, a menudo, se usa para terminar un entrenamiento de bíceps.","created":"2023-08-06T10:17:17.349574+02:00","category":8,"muscles":[1,13],"muscles_secondary":[],"equipment":[],"language":4,"license":2,"license_author":"cshep442","variations":[],"author_history":["cshep442","Franpol"]},{"id":2278,"uuid":"386f8e8c-58d6-4ec5-93c9-e504049f45a6","name":"Bodyweight Squat HD","exercise_base":1312,"description":"La sentadilla es un tipo de ejercicio de peso corporal. Es uno de los ejercicios más populares para la fuerza y el crecimiento muscular. La sentadilla es particularmente efectiva para enfocarse en los músculos de la pierna y las caderas.\nLas sentadillas son un ejercicio fácil de hacer para los principiantes. Puede ayudar a fortalecer los músculos de las piernas, tensar los músculos de la cadera y quemar calorías para perder peso.\nAprieta los glúteos y las piernas. Las sentadillas son muy efectivas para reafirmar y fortalecer las piernas al actuar sobre los glúteos, los flexores de la cadera, los cuádriceps, los isquiotibiales y los músculos internos del muslo. Además, las sentadillas con peso corporal pueden ayudar a dar forma a los glúteos.","created":"2024-06-30T09:59:08.038976+02:00","category":15,"muscles":[10],"muscles_secondary":[7,8,14,6,15],"equipment":[7],"language":4,"license":2,"license_author":"hektkaso","variations":[],"author_history":["hektkaso"]},{"id":2082,"uuid":"176fdc67-24e4-4485-b55d-accb1c87f067","name":"Contragolpe de tríceps con mancuernas","exercise_base":655,"description":"Comience con una mancuerna en cada mano y las palmas de las manos hacia el torso. Mantenga la espalda recta con una ligera flexión de las rodillas e inclínese hacia adelante por la cintura. Tu torso debe estar casi paralelo al piso. Asegúrate de mantener la cabeza en alto. Tus brazos superiores deben estar cerca de tu torso y paralelos al piso. Tus antebrazos deben apuntar hacia el suelo mientras sostienes las pesas. Debe haber un ángulo de 90 grados formado entre el antebrazo y la parte superior del brazo. Esta es tu posición de inicio. Ahora, mientras mantiene la parte superior de sus brazos inmóviles, exhale y use sus tríceps para levantar las pesas hasta que el brazo esté completamente extendido. Concéntrese en mover el antebrazo. Después de una breve pausa en la contracción superior, inhala y baja lentamente las mancuernas hasta la posición inicial. Repita el movimiento la cantidad prescrita de repeticiones. Variaciones: este ejercicio también se puede ejecutar con un brazo a la vez, al igual que se realizan las filas de un brazo. Además, si le gusta la variedad de un solo brazo, puede usar un mango de polea baja en lugar de una mancuerna para una mejor contracción máxima. En este caso, las palmas deben estar hacia arriba (agarre en supinación) en lugar del torso (agarre neutral).","created":"2023-08-06T10:17:17.349574+02:00","category":8,"muscles":[5],"muscles_secondary":[],"equipment":[3],"language":4,"license":1,"license_author":"http://www.bodybuilding.com/","variations":[],"author_history":["http://www.bodybuilding.com/","Franpol"]},{"id":2096,"uuid":"ae5be74f-29cc-4856-8b07-c97d55e535c6","name":"Curl cuadriceps","exercise_base":369,"description":"La extensión de piernas es un ejercicio de entrenamiento con pesas de resistencia que se enfoca en el músculo cuádriceps de las piernas. El ejercicio se realiza utilizando una máquina llamada Leg Extension Machine. Hay varios fabricantes de estas máquinas y cada uno es ligeramente diferente. La mayoría de los gimnasios y salas de pesas tendrán la máquina en sus instalaciones. La extensión de piernas es un ejercicio aislado dirigido a un grupo muscular específico, los cuádriceps. No debe considerarse como un entrenamiento total de piernas, como la sentadilla o el peso muerto. El ejercicio consiste en doblar la pierna a la altura de la rodilla y extender las piernas, para luego volver a bajarlas a la posición original.","created":"2023-08-06T10:17:17.349574+02:00","category":9,"muscles":[10],"muscles_secondary":[],"equipment":[],"language":4,"license":3,"license_author":"BFad07","variations":[],"author_history":["Franpol","BFad07"]},{"id":2117,"uuid":"3cb8801d-b6e1-48ee-a82c-834d3b162d60","name":"Curl de biceps alterno","exercise_base":1012,"description":"Posición inicial: Comience de pie con pesas en cada mano, la espalda recta y los pies separados al ancho de las caderas. Tus brazos deben estar relajados, apuntando hacia abajo. Tus rodillas deben estar ligeramente flexionadas, tus abdominales contraídos y tus hombros hacia abajo.&nbsp;Pasos:&nbsp;\n1. Dobla un brazo por el codo, llevando la mancuerna hasta tu hombro. La parte superior del brazo debe permanecer inmóvil durante este movimiento. 2. Lleva la mancuerna hacia abajo hasta que tu brazo esté en su posición original relajada.&nbsp;\n3. Repita, cambiando de brazo.","created":"2023-08-06T10:17:17.349574+02:00","category":8,"muscles":[],"muscles_secondary":[],"equipment":[3],"language":4,"license":2,"license_author":null,"variations":[],"author_history":["Franpol"]},{"id":2091,"uuid":"b09ec887-c939-47e2-b3a3-7842df52cb79","name":"Curl de biceps con barra Z","exercise_base":94,"description":"Sostenga la barra SZ a la altura de los hombros, la espalda recta, los hombros ligeramente hacia atrás, los brazos estirados. Dobla los brazos, elevando el peso, con un movimiento rápido. Sin pausa, baja la barra con un movimiento lento y controlado.\n\nNo dejes que tu cuerpo se balancee durante el ejercicio, todo el trabajo lo hacen los bíceps, que son los únicos músculos que deben moverse (presta atención a los codos).","created":"2023-08-06T10:17:17.349574+02:00","category":8,"muscles":[1],"muscles_secondary":[13],"equipment":[2],"language":4,"license":1,"license_author":"wger.de","variations":[2051,2091],"author_history":["wger.de","Franpol"]},{"id":2051,"uuid":"a3ed40fb-83d3-4901-889f-6bba313e8c80","name":"Curl de bíceps con mancuerna","exercise_base":92,"description":"Sujeta dos pesas, los brazos estirados, las manos a los lados, las palmas hacia dentro. Flexiona los brazos y sube el peso con un movimiento rápido. Al mismo tiempo, gira los brazos 90 grados al principio del movimiento. En el punto más alto, gira un poco las pesas hacia fuera. Sin pausa, bájalas lentamente.No permitas que tu cuerpo se balancee durante el ejercicio, todo el trabajo lo realizan los bíceps, que son los únicos músculos que deben moverse (presta atención a los codos).","created":"2023-08-06T10:17:17.349574+02:00","category":8,"muscles":[1],"muscles_secondary":[13],"equipment":[3],"language":4,"license":1,"license_author":"wger.de","variations":[2051,2091],"author_history":["wger.de","colundrum"]},{"id":2134,"uuid":"d809851e-143a-442e-8724-5c0341c09cbf","name":"Curl de predicador inverso","exercise_base":913,"description":"Sentado al revés en un banco de bíceps con un agarre estrecho","created":"2023-08-06T10:17:17.349574+02:00","category":8,"muscles":[1],"muscles_secondary":[],"equipment":[2],"language":4,"license":2,"license_author":"novadani","variations":[],"author_history":["novadani","Franpol"]},{"id":2110,"uuid":"861b7564-d1e7-499f-9bcb-6f12d3b34fe3","name":"Curl femoral","exercise_base":364,"description":"El curl de piernas, también conocido como curl de isquiotibiales, es un ejercicio de aislamiento que se enfoca en los músculos isquiotibiales. El ejercicio consiste en flexionar la parte inferior de la pierna contra la resistencia hacia las nalgas. Otros ejercicios que se pueden utilizar para fortalecer los isquiotibiales son las elevaciones de glúteos y isquiotibiales y el peso muerto.","created":"2023-08-06T10:17:17.349574+02:00","category":9,"muscles":[11,8],"muscles_secondary":[],"equipment":[],"language":4,"license":3,"license_author":"BFad07","variations":[2110],"author_history":["BFad07","Franpol"]},{"id":1688,"uuid":"fbbf5f5b-1c0f-4e6e-b30f-7e9fcc589fe5","name":"Círculos de brazo","exercise_base":994,"description":"<ol><li>Ponte de pie con la espalda recta.</li><li>Lleva los brazos hacia delante, levántalos por encima de la cabeza y luego continúa el movimiento por detrás de la espalda y baja a la posición inicial.</li><li>Siga haciendo círculos con los brazos como se describe en el paso 2.</li></ol>","created":"2023-08-06T10:17:17.349574+02:00","category":8,"muscles":[],"muscles_secondary":[],"equipment":[7],"language":4,"license":2,"license_author":null,"variations":[1688],"author_history":["mondstern (imported from Feeel)","Diego Sanguinetti (imported from Feeel)","Gabriel Tandil (imported from Feeel)","Luis Alfredo Figueroa Bracamontes (imported from Feeel)"]},{"id":2028,"uuid":"0b068941-65c4-4ce3-ad70-c006d2bc88e2","name":"Dominadas","exercise_base":475,"description":"Toma la barra con los brazos a la altura de los hombros y las palmas de las manos hacia el frente. Intenta sacar el pecho, apretar el abdomen y tirar con las dorsales para elevarte hacia arriba hasta sobrepasar la barra con la barbilla intentando mantener el resto del cuerpo completamente estático","created":"2023-08-06T10:17:17.349574+02:00","category":12,"muscles":[12],"muscles_secondary":[2,1,9],"equipment":[6],"language":4,"license":1,"license_author":"wger.de","variations":[2028],"author_history":["wger.de","Imobard"]},{"id":2026,"uuid":"1d202190-0493-4d8a-beda-3780fdaf63e5","name":"Dominadas Supinas","exercise_base":154,"description":"Ejercicio en barra de dominadas para fortalecer la musculatura relacionada con el tirón: dorsales. En menor medida se trabajan los bíceps","created":"2023-08-06T10:17:17.349574+02:00","category":12,"muscles":[12],"muscles_secondary":[],"equipment":[6],"language":4,"license":1,"license_author":"oliser67","variations":[],"author_history":["oliser67","Imobard"]},{"id":2132,"uu